import React from 'react'

export default function BuyMoney() {
    return (
        <div>
            <h1>Enter amount</h1>
            <form>
            <input
          type="password"
          name="password"
          className="input"
          placeholder="Enter Password ..."
          style={{ paddingTop: "5px", paddingBottom: "5px" }}
          onChange={onChangePassword}
        />


            </form>
        </div>
    )
}
